import React, {useState} from "react";
import './Sidebar.css';
import { NavLink } from 'react-router-dom';
import {
  FaTh,
  FaBars,
  FaUserAlt,
  FaRegChartBar,
  FaCommentAlt,
  FaShoppingBag,
  FaThList
}from "react-icons/fa";

const NavAdmin = ({children}) => {
  const[isOpen ,setIsOpen] = useState(false);
  const toggle = () => setIsOpen (!isOpen);
  const menuItem=[
      {
          path:"/",
          name:"Dashboard",
          icon:<FaTh/>
      },
      {
          path:"/about",
          name:"About",
          icon:<FaUserAlt/>
      },
      {
          path:"/analytics",
          name:"Analytics",
          icon:<FaRegChartBar/>
      },
      {
          path:"/comment",
          name:"Comment",
          icon:<FaCommentAlt/>
      },
      {
          path:"/product",
          name:"Product",
          icon:<FaShoppingBag/>
      },
      {
          path:"/productList",
          name:"Product List",
          icon:<FaThList/>
      }
  ]
    return(
      
      <div className="container">
      </div>
    )
};

export default NavAdmin;
